        let token = this.props.match.params.token
    }
    render () {
        return (<div><Activate code={this.props.code} /></div>)
    }
}

const mapStateToProps = (state) => ({
    code: state.auth.code
})

export default connect(mapStateToProps)(ActivateContainer)
